elevAtion Aerial presents-
❤️💚Up on Santa’s Lap💚❤️
Join us for a night of Holiday Tiki fun in the Speakeasy Room at @tongahut , LA’s oldest Tiki bar! 
The beauties of @elevationaerialdance will wow and thrill you with delicious performances while you sip on custom Tiki cocktails.
💚Your ticket includes a general admission seat, custom cocktail poured from the sky by the elevAtion Aerial bartenders and reserved seating in the Tonga Hut outside lounge after the show.
💚VIP tickets includes up to 4 seats at one of our vip tables, four custom cocktail per table poured from the sky by the elevAtion Aerial bartenders, reserved seating in the Tonga Hut outside & an exclusive meet and greet plus photo with the cast after the show! 

Two shows - 7 p.m. and 9 p.m. 
Ticket link in Bio!  21+
.
